import React from 'react'

const Footer = () => {
  return (
    <footer className='bg-slate-200'>
      <div className='container mx-auto p-4'>
       <p className='text-center font-bold' title="Youtube Channel">Dynamic Coding with Amit</p>
      </div>
    </footer>
  )
}

export default Footer
